import { React, useEffect, useState, useContext } from 'react';
import { Link, Navigate } from 'react-router-dom';
import { MyContext } from '../MyContext';
import axios from "axios";

import '../pageStyling/Landing.css'
import AddButton from '../assets/Add Icon.png';
import SelectButton from '../assets/Selection Arrow.png';


const Landing = () => {

    const [username, setName] = useState(null); //For testing purposes, username will come from login
    const [balances, setBalances] = useState([]);
    const [displayIndex, setDisplay] = useState(14);

    const [balancesOpen, setBalancesOpen] = useState(false);
    const [transactionsOpen, setTransactionsOpen] = useState(false);

    const { user_id, setUserID, validated, setValidated } = useContext(MyContext);

    const toggleBalanceList = () => {
        setBalancesOpen(!balancesOpen);
    };

    const toggleTransactionList = () => {
        setTransactionsOpen(!transactionsOpen);
    };

    const selectorAction = (selection) => {
        setBalancesOpen(!balancesOpen);
        setDisplay(selection);
    };



    useEffect(() => {
        const getName = async () => {
            try {
                const nameresp = await axios.get('/api/getNames', {
                    params: {
                        user_id: user_id
                    }
                });
                console.log("Names - 1: ", nameresp.data);
                setName(nameresp.data[0].username);
            }
            catch (e) {
                console.log("Error: ", e);
            }
        }
        const getBalances = async () => {
            try {
                await axios.post('/api/createTables');
                const response = await axios.get('/api/getBalances', {
                    params: {
                        user_id: user_id
                    }
                });
                setBalances(response.data);
                setDisplay(0);
                console.log("Data: ", response.data);
                console.log("Display Index: ", displayIndex)
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };

        // Call the async function
        getName();
        getBalances();
    }, []);

    if (!validated) {
        return <Navigate to={'/login'} />
    }

    if (displayIndex === null) {
        return <div> Loading... </div>
    }

    return (
        <div className="dashboard">
            <h1 className="title">Welcome {username}</h1>

            <div className="balanceBox">
                <div className="balance-header">
                    <button className="dropdown-button" onClick={() => setBalancesOpen(!balancesOpen)}>
                        <h1>{balances[displayIndex]?.balance_name.replace(/^"|"$/g, '')}</h1>
                        <img src={SelectButton} alt="Select" className="select-icon" />
                    </button>

                    {balancesOpen && (
                        <ul className="menu-list">
                            {balances.map((balance, index) => (
                                <button 
                                    key={index}
                                    onClick={() => {
                                        setDisplay(index);
                                        setBalancesOpen(false);
                                    }}
                                >
                                    {balance.balance_name.replace(/^"|"$/g, '')}
                                </button>
                            ))}
                        </ul>
                    )}
                </div>
                <h2>${balances[displayIndex]?.amount}</h2>
            </div>

            <Link to="/balancemanager" className="button-link">
                Manage Balances
            </Link>

            <div className="corner-menu">
                <button className="dropdown-button" onClick={() => setTransactionsOpen(!transactionsOpen)}>
                    <img src={AddButton} alt="Add" className="icon" />
                </button>

                {transactionsOpen && (
                    <ul className="menu-list">
                        {['Income', 'Spending', 'Credit Payment', 'Transfer'].map((item) => (
                            <button key={item}>{item}</button>
                        ))}
                    </ul>
                )}
            </div>

            <button onClick={() => {
                setUserID(null);
                setValidated(false);
            }}>
                Logout
            </button>
        </div>
    );

};

export default Landing;
